import * as React from "react";
import {
  View,
  useWindowDimensions,
  TextInput,
  StyleSheet,
  TouchableOpacity,
  Text,
} from "react-native";
import { TabView, SceneMap } from "react-native-tab-view";
import { Table, TableWrapper, Row, Cell } from "react-native-table-component-2";
import { Searchbar } from "react-native-paper";

const element = (data, index) => (
  <TouchableOpacity onPress={() => this._alertIndex(index)}>
    <View style={styles.btn}>
      <Text style={styles.btnText}>ha</Text>
    </View>
    <TouchableOpacity onPress={() => this._alertIndex(index)}>
      <View style={styles.btn1}>
        <Text style={styles.btnText}>ho</Text>
      </View>
    </TouchableOpacity>
  </TouchableOpacity>
);
function FirstRoute() {
  const [searchQuery, setSearchQuery] = React.useState("");

  const onChangeSearch = (query) => setSearchQuery(query);
  const [tableHead] = React.useState([
    "Б/нэр",
    "Б/код",

  ]);
  const [tableData] = React.useState([
    ["1", "2", "3", "4", "3", "4", "4"],
    ["a", "b", "c", "d", "3", "4", "4"],
    ["1", "2", "3", "4", "3", "4", "4"],
    ["a", "b", "c", "d", "3", "4", "4"],
  ]);
  return (
    <View style={{ flex: 1 }}>
      <View>
        <Searchbar
          style={styles.search}
          placeholder="Search"
          onChangeText={onChangeSearch}
          value={searchQuery}
        />
      </View>
      <Table borderStyle={{ borderColor: "transparent" }}>
        <Row data={tableHead} style={styles.head} textStyle={styles.text} />
        {tableData.map((rowData, index) => (
          <TableWrapper key={index} style={styles.row}>
            {rowData.map((cellData, cellIndex) => (
              <Cell
                key={cellIndex}
                data={cellIndex === 6 ? element(cellData, index) : cellData}
                textStyle={styles.text}
              />
            ))}
          </TableWrapper>
        ))}
      </Table>
    </View>
  );
}

function SecondRoute() {
  const [searchQuery, setSearchQuery] = React.useState("");

  const onChangeSearch = (query) => setSearchQuery(query);
  const [tableHead] = React.useState([
    "Б/нэр",
    "Б/код",
    "Тоо",
    "үнэ",
    "огноо",
    "Д/огноо",
    "Засах",
  ]);
  const [tableData] = React.useState([
    ["1", "2", "3", "4", "3", "4", "4"],
    ["a", "b", "c", "d", "3", "4", "4"],
    ["1", "2", "3", "4", "3", "4", "4"],
    ["a", "b", "c", "d", "3", "4", "4"],
  ]);
  return (
    <View style={{ flex: 1 }}>
      <View>
        <Searchbar
          placeholder="Search"
          onChangeText={onChangeSearch}
          value={searchQuery}
        />
      </View>
      <Table borderStyle={{ borderColor: "transparent" }}>
        <Row data={tableHead} style={styles.head} textStyle={styles.text} />
        {tableData.map((rowData, index) => (
          <TableWrapper key={index} style={styles.row}>
            {rowData.map((cellData, cellIndex) => (
              <Cell
                key={cellIndex}
                data={cellIndex === 6 ? element(cellData, index) : cellData}
                textStyle={styles.text}
              />
            ))}
          </TableWrapper>
        ))}
      </Table>
    </View>
  );
}
function TwoRoute() {
  const [searchQuery, setSearchQuery] = React.useState("");

  const onChangeSearch = (query) => setSearchQuery(query);
  const [tableHead] = React.useState([
    "Б/нэр",
    "Б/код",
    "Тоо",
    "үнэ",
    "огноо",
    "Д/огноо",
    "Засах",
  ]);
  const [tableData] = React.useState([
    ["1", "2", "3", "4", "3", "4", "4"],
    ["a", "b", "c", "d", "3", "4", "4"],
    ["1", "2", "3", "4", "3", "4", "4"],
    ["a", "b", "c", "d", "3", "4", "4"],
  ]);
  return (
    <View style={{ flex: 1 }}>
      <View>
        <Searchbar
          placeholder="Search"
          onChangeText={onChangeSearch}
          value={searchQuery}
        />
      </View>
      <Table borderStyle={{ borderColor: "transparent" }}>
        <Row data={tableHead} style={styles.head} textStyle={styles.text} />
        {tableData.map((rowData, index) => (
          <TableWrapper key={index} style={styles.row}>
            {rowData.map((cellData, cellIndex) => (
              <Cell
                key={cellIndex}
                data={cellIndex === 6 ? element(cellData, index) : cellData}
                textStyle={styles.text}
              />
            ))}
          </TableWrapper>
        ))}
      </Table>
    </View>
  );
}

const renderScene = SceneMap({
  first: FirstRoute,
  second: SecondRoute,
  Two: TwoRoute,
});

export default function TabViewExample() {
  const layout = useWindowDimensions();

  const [index, setIndex] = React.useState(0);
  const [routes] = React.useState([
    { key: "first", title: "Агуулах" },
    { key: "second", title: "Лангуу" },
    { key: "Two", title: "Зарагдсан" },
  ]);

  return (
    <TabView
      navigationState={{ index, routes }}
      renderScene={renderScene}
      onIndexChange={setIndex}
      initialLayout={{ width: layout.width }}
    />
  );
}
const styles = StyleSheet.create({
  input: {
    height: 40,
    margin: 12,
    borderWidth: 1,
    padding: 10,
  },
  container: { flex: 1, padding: 16, paddingTop: 30, backgroundColor: "#fff" },
  head: { height: 40, backgroundColor: "#19F91C" },
  text: { margin: 6 },
  row: {
    flexDirection: "row",
    backgroundColor: "#FFFFFF",
    borderWidth: 1,
  },
  btn: { width: 58, height: 18, backgroundColor: "red", borderRadius: 2 },
  btn1: { width: 58, height: 18, backgroundColor: "green", borderRadius: 2 },
  btnText: { textAlign: "center", color: "#fff" },
});
